import blog_section from "./blog_section.vue";
import { App } from "vue";
import { createWebHistory, createRouter } from "vue-router";

const routes = [
  {
    path: "/",
    name: "Home",
    component: Home,
  },
  {
    path: "/blog_section",
    name: "blog_section",
    component: blog_section,
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
